import React from "react";

class Floors extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            floors: 5
        };
    }

    componentDidMount = () => {
    };


    render() {
        var floorDetails;
        floorDetails = this.state.floors.map((item, i) => {
            return <div className="floorNum"></div>;
        });

        return (
            <div className="floorsWrapper">
                {floorDetails}
            </div>
        );
    }
}

export default Floors;
